import React from 'react';

import './App.css';
import moment from 'moment';

function App() {
  return (
    <div className="App">
      <header className="App-header">
       <h1> November React stuff</h1>
        <p>
          Edit  and save to reload.


          <p>today's date {moment().format("MMMM Do YYYY")}</p>
        </p>


      </header>
    </div>
  );
}

export default App;
